import React from "react";
import "./index.css";
import { Logo } from "./logo";
import { BreadCrumbs } from "./breadcrumbs";
import { SearchBar } from "./search-bar";
import { Platforms } from "./platforms";

const Navbar = function (props) {
  return (
    <div>
      <div>
        <Logo />
        <BreadCrumbs />
        <SearchBar />
      </div>
      <div>
        <Platforms/>
      </div>
    </div>
  );
};
export default Navbar;
